    const [visible, setVisible] = useState(true)
  return (
    <button onClick={() => {setVisible( v => !v); handleVisibility(visible)}} className=' absolute'>{visible ? <VisibilityIcon/> : <VisibilityOffIcon/>}</button>
  )
}

export default Eyes
